mapper.select:

select 

from MSGOUT
where MSGOUT_TXDATE = #{msgoutTxdate,jdbcType=CHAR}
  and MSGOUT_BRNO = #{msgoutBrno,jdbcType=CHAR}
  and MSGOUT_FEPNO = #{msgoutFepno,jdbcType=CHAR}

mapper.delete:

delete from MSGOUT
where MSGOUT_TXDATE = #{msgoutTxdate,jdbcType=CHAR}
  and MSGOUT_BRNO = #{msgoutBrno,jdbcType=CHAR}
  and MSGOUT_FEPNO = #{msgoutFepno,jdbcType=CHAR}
